import "./scss/app.scss";

function App() {

  return (
    <div className="wrapper">
      <Header/>
      <div className="content">
          <Routes>
              <Route path="/" element={<Home/>}/>
              <Route path="/cart" element={<Cart/>}/>
              <Route path="*" element={<NotFound/>}/>
          </Routes>
        </div>
    </div>
  );
}

export default App;
